import React, { useState } from 'react';
import InterviewGuidance from '../components/student/InterviewGuidance';
import JobListings from '../components/student/JobListings';
import Notifications from '../components/student/Notifications';
import ResourceLinks from '../components/student/ResourceLinks';
import ResumeUpload from '../components/student/ResumeUpload';

const StudentDashboard = () => {
  const [activeFeature, setActiveFeature] = useState('resume-upload');

  const handleFeatureClick = (feature) => {
    setActiveFeature(feature);
  };

  return (
    <div className="student-dashboard">
      {/* Heading with background color */}
      <div className="dashboard-heading">
        <h1>Student Dashboard</h1>
      </div>

      <div className="dashboard-layout">
        {/* Left Side: Feature Navigation */}
        <div className="feature-navigation">
          <ul>
            <li
              className={activeFeature === 'resume-upload' ? 'active' : ''}
              onClick={() => handleFeatureClick('resume-upload')}
            >
              Resume Upload
            </li>
            <li
              className={activeFeature === 'job-listings' ? 'active' : ''}
              onClick={() => handleFeatureClick('job-listings')}
            >
              Job Listings
            </li>
            <li
              className={activeFeature === 'notifications' ? 'active' : ''}
              onClick={() => handleFeatureClick('notifications')}
            >
              Notifications
            </li>
            <li
              className={activeFeature === 'interview-guidance' ? 'active' : ''}
              onClick={() => handleFeatureClick('interview-guidance')}
            >
              Interview Guidance
            </li>
            <li
              className={activeFeature === 'resource-links' ? 'active' : ''}
              onClick={() => handleFeatureClick('resource-links')}
            >
              Resource Links
            </li>
          </ul>
        </div>

        {/* Right Side: Feature Content */}
        <div className="feature-content">
          {activeFeature === 'resume-upload' && <ResumeUpload />}
          {activeFeature === 'job-listings' && <JobListings />}
          {activeFeature === 'notifications' && <Notifications />}
          {activeFeature === 'interview-guidance' && <InterviewGuidance />}
          {activeFeature === 'resource-links' && <ResourceLinks />}
        </div>
      </div>
    </div>
  );
};

export default StudentDashboard;
